#include<stdio.h>
#include<string.h>
int main()
{
	int i,j,t,k;
	char m[1005],c[105];
	while(scanf("%s%s",c,m)==2)
	{
		t=strlen(c);
		for(i=0;i<t;i++)
			if(c[i]<='Z')c[i]-='A';else c[i]-='a';
		for(i=0,j=0;i<strlen(m);i++)
		{
			k=m[i]-c[j++];
			if(m[i]>='a')if(k>='a')printf("%c",k);else printf("%c",k+26);
			else if(k>='A')printf("%c",k);else printf("%c",k+26);
			if(j==t)j=0;
		}
		printf("\n");
	}
	return 0;
}

