var
  k,c:ansistring;
  lenk,lenc,i,t,x,y,f:longint;
  b:array[1..2000]of boolean;
  ch:char;
begin
  readln(k);
  readln(c);
  lenk:=length(k);
  lenc:=length(c);
  fillchar(b,sizeof(b),false);
  for i:=1 to lenc do
    if c[i] in ['a'..'z'] then
      b[i]:=true;
  f:=0;
  k:=upcase(k);
  c:=upcase(c);
  for i:=1 to lenc do
  begin
    f:=f+1;
    x:=ord(c[i]);
    if f>lenk then f:=1;
    y:=ord(k[f]);
    t:=x-(y-ord('A'));
    if t<ord('A') then t:=t+26;
    ch:=chr(t);
    if b[i] then write(chr(ord(ch)+32))
      else write(ch);
  end;
  writeln;
end.

import java.util.Scanner;

public class Main {
	public static void main(String[] args) {
		Scanner scanner = new Scanner(System.in);
		while (scanner.hasNextLine()) {
			String key = scanner.nextLine(), encoded = scanner.nextLine();
			System.out.println(decode(encoded, key));
		}
	}

	public static String decode(String encoded, String key) {
		key = key.toLowerCase();
		String decoded = "";
		for (int i = 0; i < encoded.length(); i++) {
			char c = encoded.charAt(i);
			int shift = key.charAt(i % key.length()) - 'a';
			if (c >= 'A' && c <= 'Z') {
				int offset = c - 'A';
				c = (char)('A' + (offset + 26 - shift) % 26);
			} else if (c >= 'a' && c <= 'z') {
				int offset = c - 'a';
				c = (char)('a' + (offset + 26 - shift) % 26);
			}
			decoded += c;
		}
		return decoded;
	}
}
